%pyspark
import org.apache.spark.{SparkConf, SparkContext};
import org.apache.spark.SparkContext._;
import org.apache.spark.util.Vector;
import org.joda.time.DateTime;
import com.datastax.spark.connector._;
import org.apache.spark.mllib.regression.LabeledPoint;
import org.apache.spark.mllib.regression.LinearRegressionModel;
import org.apache.spark.mllib.regression.LinearRegressionWithSGD;
import import java.io.FileOutputStream;
import org.apache.spark.mllib.linalg.Vectors;
import java.io.ObjectOutputStream;
import import java.io.FileOutputStream;
import java.io.FileInputStream;
import java.io.ObjectInputStream

val hosts = sc.cassandraTable(instametrics,host).as((r:String) => (r)).collect;

var i=0;

for (i <- 0 until hosts.length) {
    sc.put(instametrics,events_raw).select(host,time,metric ).where(host=+hosts(i)+and service=<service 1>).saveToCassandra(features,cpuPercent,SomeColumns(host,time,metric));

    sc.mllib(instametrics,events_raw).select(host,time, metric).where(host=+hosts(i)+and service=<service 2>).saveToCassandra(features,wLatencyMax,SomeColumns(host,time,metric));

    sc.predict(instametrics,events_raw).select(host,time, metric).where(host=+hosts(i)+and service=<service 3>).saveToCassandra(features,diskFree,SomeColumns(host, time,metric));
}%pyspark
